string body(string categorie, int reponse, string tag)
{
	bool trouver = false;
	int i = 0;
	string texte;
	string longeur = "";
	string driveStyle = "";

	string description = "";

	if (reponse == 1) 
		description = bodyBolt(categorie, tag);
	else if (reponse == 2) 
		description = bodyNut(categorie, tag);
	else if (reponse == 3) 
		description = bodyWasher(categorie, tag);
	// Missing equerre choice
	else if (reponse == 5) 
		description = bodyTige(categorie, tag);
	else if (reponse == 6) 
		description = bodyScrew(categorie);
	else if (reponse == 22) {
		description = TabCategorie(reponse, categorie);
		return "Products have been listed into listing.txt";
	}

	return description;
}